import React from 'react';
import './Collab.css'
import { BsBookmarkCheck } from "react-icons/bs";

function Collab(props) {
    return (
        <section className="mar-top-bot-50 mar-top-100"  data-aos="fade-up" data-aos-anchor-placement="top-bottom">
            <h2 className="align-center">Our Collaborations</h2>
            <div className="heading-underline-center"><div className="heading-underline"></div></div>
            &nbsp;
            <div className="container" data-aos="fade-up" data-aos-delay="100">
                <p>E-Cell, Karunya is associated with many companies and organisations that would help budding entrepreneurs get a head start for their venture. These collaborations are beneficial for the students of Karunya to help them grow in their entrepreneurial journeys.</p>
                <h4>A few collaborations we currently have are</h4>
                &nbsp;
                <span>
                    <p data-aos="fade-up" data-aos-delay="200"><BsBookmarkCheck color="red" fontSize="larger" /> &nbsp; <i>YNOS Venture Engine- YNOS Venture Engine is a technology platform for business intelligence and fundraising analytics for nascent and early-stage entrepreneurs. The YNOS platform helps to understand the startup landscape, estimate the valuation, identify the apt investors and obtain top-notch expert consultation, all in one place.
                    <br />YNOS in partnership with E-Cell, Karunya provides our students with free membership accounts and helps our students connect with potential investors to help grow their startup idea. 
<br />YNOS helps students at Karunya along their entrepreneurial journey by connecting them to investors, evaluating the ventures, providing expert opinions and other necessary support and guidance to the students and their start-ups.
<br />YNOS and its team are a great help to budding entrepreneurs from Karunya by guiding their ventures along the right path by providing the right guidance and help.</i></p>
                    <p data-aos="fade-up" data-aos-delay="300"><BsBookmarkCheck color="red" fontSize="larger" />&nbsp; <i> Showcasing your company brand during the Hackathon, allows you a better platform to broadcast your company stature, thus boosting brand recognition, hence encouraging students to know more about your company</i></p>
                    <p data-aos="fade-up" data-aos-delay="400"><BsBookmarkCheck color="red" fontSize="larger" />&nbsp; <i> Also we will promote your brand throughout our event through social media platforms and other platforms</i></p>
                </span>
            </div>
        </section>
    );
}

export default Collab;
